import data from "./Data2";
import "./Content.css";
import Item from "./Item";
const Content = (props) => {
  let length;
  if (props.notindex === -1) {
    length = data.properties.length;
  } else {
    length = data.properties.length - 1;
  }
  const properties = data.properties;
  return (
    <div className="wrapper">
      {properties.map((value) => {
        if (value.index !== props.notindex) {
          if (value.index % 4 === 0) {
            if (length % 4 === 0) {
              return (
                <Item
                  one={value.index}
                  two={value.index + 1}
                  three={value.index + 2}
                  four={value.index + 3}
                  sign={1}
                  key={data.properties[value.index]._id}
                />
              );
            } else if (length % 4 === 1) {
              if (value.index < data.properties.length - 1) {
                return (
                  <Item
                    one={value.index}
                    two={value.index + 1}
                    three={value.index + 2}
                    four={value.index + 3}
                    sign={1}
                    key={data.properties[value.index]._id}
                  />
                );
              } else {
                return (
                  <Item
                    one={value.index}
                    sign={2}
                    key={data.properties[value.index]._id}
                  />
                );
              }
            } else if (length % 4 === 2) {
              if (value.index < data.properties.length - 2) {
                return (
                  <Item
                    one={value.index}
                    two={value.index + 1}
                    three={value.index + 2}
                    four={value.index + 3}
                    sign={1}
                    key={data.properties[value.index]._id}
                  />
                );
              } else {
                return (
                  <Item
                    one={value.index}
                    two={value.index + 1}
                    sign={2}
                    key={data.properties[value.index]._id}
                  />
                );
              }
            } else if (length % 4 === 3) {
              if (value.index < data.properties.length - 3) {
                return (
                  <Item
                    one={value.index}
                    two={value.index + 1}
                    three={value.index + 2}
                    four={value.index + 3}
                    sign={1}
                    key={data.properties[value.index]._id}
                  />
                );
              } else {
                return (
                  <Item
                    one={value.index}
                    two={value.index + 1}
                    three={value.index + 2}
                    sign={2}
                    key={data.properties[value.index]._id}
                  />
                );
              }
            }
          }
        }
      })}
    </div>
  );
};
export default Content;
